import React from 'react'
import { Header, Questions, Footer, Process, CallToAction } from '../../containers';
// import Navbar from '../../components/navbar/Navbar'
import { Navbar, Navbar4 } from '../../components';

const Home = ({nav}) => {

  const components = {
    Navbar,
    Navbar4,
  };

  const connected = nav;
  const NavSelect = connected ? components.Navbar : components.Navbar;

  return (
    <div>
      {/* <Navbar/> */}
      <NavSelect />
      <Header/>
        {/* <div className="grey__bg">
          <Testimonials/>
      </div> */}
      <Process/>
      <Questions/>
      <CallToAction/>
      <div className="grey__bg">
        <Footer/>
      </div>
    </div>
  )
}

export default Home
